import React from 'react';
import '@vkontakte/vkui/dist/vkui.css';
import { View, Panel, PanelHeader, FormLayout, FormLayoutGroup, Input } from '@vkontakte/vkui';

const AddSkinPanel = props => (
<View activePanel="add_panel">
  <Panel id={props.id}>
    <PanelHeader>
      Заполните данные
    </PanelHeader>
    <FormLayout>
      <FormLayoutGroup>
        <Input top="Ваш никнейм" />
        <Input top="Ваш игровой ID" />
      </FormLayoutGroup>
    </FormLayout>
  </Panel>
</View>
        )
export default AddSkinPanel;
